import { Injectable} from "@angular/core";
import {Actions, createEffect, ofType} from "@ngrx/effects";
import {DataActions} from "../actions/application.actions";
import {map, mergeMap} from "rxjs";
import {DataService} from "../services/data.service";


@Injectable()
export class ApplicationProfileEffects {
  constructor(
    private actions$: Actions,
    private data: DataService,
  ) {}

  loadApplicationProfiles$ = createEffect(() => this.actions$.pipe(
    ofType(DataActions.applicationsPanelLoaded),
    mergeMap(() => this.data.getApplicationProfiles()),
    map(profiles => DataActions.applicationProfilesReceived({profiles})),
  ))

  loadConsents$ = createEffect(() => this.actions$.pipe(
    ofType(DataActions.applicationsPanelLoaded),
    map(() => ({type: 'none'})),

  ))

  receivedApplicationProfiles$ = createEffect(() => this.actions$.pipe(
    ofType(DataActions.applicationProfilesReceived),
    map(({profiles}) => profiles),
    mergeMap(profiles => profiles),
    map(profile => DataActions.applicationProfileReceived({profile})),
  ))
}

import {Injectable} from "@angular/core";
import {Actions, createEffect, ofType} from "@ngrx/effects";
import {catchError, EMPTY, map, mergeMap, tap} from "rxjs";
import {IdentityService} from "../services/login.service";
import {CoreActions} from "../actions";

@Injectable()
export class CoreEffects {

  constructor(
    private actions$: Actions,
    private id: IdentityService,
  ) {}

  login$ = createEffect(() => this.actions$.pipe(
    ofType(CoreActions.loginRequested),
    tap(({idP}) => this.id.login(idP)),
    map(() => CoreActions.loginInitiated()),
  ))

  getWebId$ = createEffect(() => this.actions$.pipe(
    ofType(CoreActions.requestWebId),
    mergeMap(() => this.id.getWebId().pipe(
      map(webId => CoreActions.webIdReceived({webId})),
      catchError(() => EMPTY),
    )),
  ))
}

import { Injectable } from '@angular/core';
import {HttpClient} from "@angular/common/http";
import { Observable} from "rxjs";
import {Application} from '../view-models';

@Injectable({
  providedIn: 'root'
})
export class DataService {

  constructor(
    private http: HttpClient,
  ) { }

  getApplicationProfiles(): Observable<Application[]> {
    return this.http.get<Application[]>('/api/applications', { responseType: 'json'});
  }

  // TODO (angel) typing
  getDescription(applicationId: string, lang: string): Observable<[]> {
    return this.http.get<[]>(`/api/descriptions/${encodeURI(applicationId)}/${lang}`, {responseType: 'json'});
  }
}

import {Injectable} from "@angular/core";
import {DataService} from "../services/data.service";
import {Actions, createEffect, ofType} from "@ngrx/effects";
import { DescActions } from "../actions/description.actions";
import {catchError, EMPTY, map, mergeMap} from "rxjs";

@Injectable()
export class DescriptionEffects {
  constructor(
    private actions$: Actions,
    private data: DataService,
  ) {}

  loadApplicationDescriptions$ = createEffect(() => this.actions$.pipe(
    ofType(DescActions.descriptionsNeeded),
    mergeMap(props => this.data.getDescription(props.applicationId, props.lang).pipe(
